import { useState } from "react";
import { Eye, EyeOff } from "lucide-react";
import { Link } from "react-router-dom";
import { Button } from "./ui/button";
import { Input } from "./ui/input";
import { Card, CardContent } from "./ui/card";

export default function LoginPage() {
  const [showPassword, setShowPassword] = useState(false);
  const [isForgotPassword, setIsForgotPassword] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData(e.currentTarget);
    const payload = Object.fromEntries(formData.entries());

    const endpoint = isForgotPassword
      ? "/api/auth/forgot-password"
      : "/api/auth/login";

    const response = await fetch(endpoint, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(payload),
    });

    const data = await response.json();
    alert(data.message || "Success!");
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-white px-4">
      <Card className="w-full max-w-lg shadow-2xl rounded-2xl overflow-hidden">
        <CardContent className="p-10 bg-gray-50 flex flex-col justify-center">
          <h2 className="text-2xl font-bold mb-6 text-center">
            {isForgotPassword ? "Forgot Password" : "Welcome Back"}
          </h2>
          <p className="text-gray-500 text-center mb-8">
            {isForgotPassword
              ? "Enter your email to reset your password"
              : "Access your AI learning journey"}
          </p>

          <form className="space-y-4" onSubmit={handleSubmit}>
            {isForgotPassword ? (
              <Input
                type="email"
                name="email"
                placeholder="Email Address"
                required
                className="p-3 rounded-xl"
              />
            ) : (
              <>
                <Input
                  type="email"
                  name="email"
                  placeholder="Email Address"
                  required
                  className="p-3 rounded-xl"
                />
                <div className="relative">
                  <Input
                    type={showPassword ? "text" : "password"}
                    name="password"
                    placeholder="Password"
                    required
                    className="p-3 rounded-xl pr-10"
                  />
                  <button
                    type="button"
                    className="absolute right-3 top-3 text-gray-500"
                    onClick={() => setShowPassword(!showPassword)}
                  >
                    {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
                  </button>
                </div>
              </>
            )}

            {!isForgotPassword && (
              <div className="flex justify-between items-center text-sm text-gray-600">
                <label className="flex items-center gap-2">
                  <input type="checkbox" /> Keep me logged in
                </label>
                <button
                  type="button"
                  onClick={() => setIsForgotPassword(true)}
                  className="text-blue-600"
                >
                  Forgot Password?
                </button>
              </div>
            )}

            <Button
              className="w-full rounded-xl bg-blue-600 hover:bg-blue-700 text-white p-3"
              type="submit"
            >
              {isForgotPassword ? "Send Reset Link" : "Log In"}
            </Button>
          </form>

          {!isForgotPassword && (
            <>
              <div className="my-6 text-center text-gray-400 text-sm">Or</div>
              <div className="flex gap-4 justify-center">
                <button className="border p-3 rounded-full">
                  <img src="/assets/google_icon.svg" alt="Google" className="h-6 w-6" />
                </button>
                <button className="border p-3 rounded-full">
                  <img src="/assets/apple_icon.svg" alt="Apple" className="h-6 w-6" />
                </button>
              </div>
            </>
          )}

          <p className="text-center text-gray-600 mt-6">
            Donâ€™t have an account?
            <Link to="/signup" className="ml-2 text-blue-600 font-semibold">
              Sign Up
            </Link>
          </p>
        </CardContent>
      </Card>
    </div>
  );
}
